function Cart() {
    const w = 300;
    return (
        <div>
            <img src="img1.jpeg" alt="flower" width={w} style={{border:"20px solid black"},{borderRadius:"50%"}} />
            <h2>NAME</h2>
        </div>
    )
}
export default Cart;
